    (state) => state.pizzaReqest.allStandartPizzaDataState
  );
  useEffect(() => {
    dispatch(getStandartPizza());
  }, [dispatch]);
  const pizzaLabels = pizzaList.map((item)=>(
    <Collapse.Panel header={<span style={{ color: 'white' }}>{item.title}</span>} key={item.id}>
                  <StandartPizzaItem
            amount={item.amount}
            ingredientsList={item.ingredientsList}
            nutrition={item.nutrition}
            size={item.size}
            styles={item.styles}
            title={item.title}
            toppingsFillings={item.toppingsFillings}
          ></StandartPizzaItem>
    </Collapse.Panel>
  ))
  pizzaList && console.log(pizzaList);
